import React from 'react';
import { List, Card } from 'antd';

const Content01 = () => {
    const data = [
        {
            title: '무직',
            content: '무직, 학생, 취업준비생, 아르바이트생 등',
            limitStart: 100,
            limitEnd: 1500
        },
        {
            title: '연체자',
            content: '대출, 카드, 통신 등 연체이력 보유자',
            limitStart: 100,
            limitEnd: 300
        },
        {
            title: '군미필',
            content: '신체검사를 받은 군미필자',
            limitStart: 100,
            limitEnd: 300
        },
        {
            title: '학생',
            content: '대학생, 휴학생, 복학생 등',
            limitStart: 100,
            limitEnd: 1500
        },
        {
            title: '무직',
            content: '무직, 학생, 취업준비생, 아르바이트생 등',
            limitStart: 100,
            limitEnd: 1500
        },
        {
            title: '주부',
            content: "등초본상 'OOO의 처",
            limitStart: 100,
            limitEnd: 3000
        }
    ]
          
    return (
        <>
        <div style={{width: '100%', padding: 50, alignItems: "center", justfiContent: 'center'}}>
            <h2 style={{textAlign: 'center', fontWeight: 'bold'}}>간편하게 보는 대출상품</h2>
        </div>
        <List
            grid={{
            gutter: 16,
            column: 2,
            xs: 1,
            sm: 2,
            md: 4,
            lg: 4,
            xl: 3,
            xxl: 3,
            }}
            dataSource={data}
            renderItem={item => (
            <List.Item>
                <Card title={item.title} size={'small'}>{item.content} <br/><br/> <h5>한도: {item.limitStart}</h5></Card>
            </List.Item>
        )}
        />,
        </>
    )
}

export default Content01;
